    "northeastern-montana-wetlands-district-annual-narrative-report-calendar-year-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Northeastern
    Montana Wetlands District outlines accomplishments during the 1981 calendar year.
    The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. Refuge administration is outlined; information about
    funding is given. Habitat management is also covered; subjects include wetlands,
    croplands, grasslands, pest control, water rights, and WPA easements. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, and fisheries
    resources. The public uses of the District described in this report include outdoor
    classrooms, hunting, and trapping. The equipment and facilities section of the report
    provides information about rehabilitation.",nt"license_title": "License Not
